import React from 'react';
import Card from './Card';

const DemoList = ({demo}) => {
    return (
        <div>
            {
            demo.map( (user,i) =>{ 
                return(
                    <Card 
                    key={i}
                    id={user.id}
                    img={user.img}
                    name={user.name} 
                    text={user.text}/>
                )
            } )

            }
        </div>
    )
}
 export default DemoList;
